import React from 'react';
import {Routes,Route,} from "react-router-dom";
import ReadOrder from "./omsOrder/ReadOrder";
import PlaceOrder from "./omsOrder/PlaceOrder";
import UpdateOrder from "./omsOrder/UpdateOrder";



function App() {
  return (
      <div className="App">
        <Routes>

          <Route exact path="/" component={ReadOrder} />
          <Route exact path="/placeorder" component={PlaceOrder} />
          <Route exact path="/UpdateOrder/:displayOrderId" component={UpdateOrder} />
          {/* <Route exact path="/Vieworder/:id" component={ViewDetails} /> */}

        </Routes>
      </div>

  );
}

export default App;
